(33, '3578171401040002', 4, 0, 'hilmi.arya2006@gmail.com', 'Digitalisasi Pelayanan Publik', 'Mohon kepada instansi terkait, untuk mengintegrasikan seluruh portal layanan milik pemkab nganjuk, yang levih baik lagi, hanya melalui 1 akun, tanpa harus bolak balik download aplikasi lain lagi hanya cukup 1 saja aplikasi yang memuat beragam layanan milik pemkab nganjuk, saat ini menjadi langkah yang baik dengan adanya nsc nganjuk smart city, tapi dirasa masih jauh dari kata puas, karna setiap layanan masih memerlukan akun yang berbeda, sebagai contoh yang sama\" menjangkau masyarakat, sedudo dan sipentol, harus log in masing\", belum lagi yang lainnya, jika bisa hanya daftar melalui apk nsc sudah bisa menikmati seluruh layanan yang ada, dengan syarat harus warga kb nganjuk, dengan verivikasi data penduduk, seperti hal nya jogja service city, jakarta kita dll, saya tau sekali wa itu mudah digunakan, seperti layanan antrian online melalui wa di rangkum jadi 1 di nsc, jadi semua kantor pemkab terdigitalisasi', '2024-06-16', 'Nganjuk', NULL, '2024-06-17 23:38:48'),
