(38, '3578171401040001', 3, 0, 'hilmi.arya2006@gmail.com', 'Laporan Jalur Kabel Pln Lewat Atas Rumah', 'Jalur kabel pln antar tiang listrik melewati atas rumah warga.\r\nkronologi:\r\nsekitar tahun 2021 telah dilakukan pemindahan jalur listrik di dusun kranjang kauman, desa sidosari, kecamatan salaman, kab. magelang. lokasi pemindahan jalur yaitu didepan balaidesa sidosari. pada awalnya jalur listrik tersebut tidak melewati tanah pekarangan saya, namun ketika dilakukan pemindahan jalur listrik, kabel pln antar tiang listrik melewati pekarangan saya dan tanpa ada ijin terlebih dahulu. pada tahun 2022 saya pekarangan tersebut saya bangun rumah, dan saya sudah berkoordinasi ke kepala desa sidosari untuk memindahkan kembali jalur listrik tersebut namun sampai sekarang tidak ada tindak lanjutnya. sehingga saat bangun rumah tersebut atap saya saya buat pendek dikarenakan kabel listrik pln atar tiang listrik tersebut tidak ada bungkusnya dan terlalu pendek, sehingga untuk keamanan rumah saya yang menggunakan baja ringan kabel tersebut saya bungkus pakai pralon.\r\nselain itu saya juga pernah lapor ke', '2024-06-17', 'Ngampelsari', , '2024-06-18 00:46:32');

